import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import App from '../shared/App';
import history from "./history"

const Root = () => (
    <BrowserRouter history={history} forceRefresh={true}>
        <App/>
    </BrowserRouter>
);

export default Root;
